import React from 'react';
import { Router, Route, Switch } from 'react-router-dom';
import { Provider } from 'react-redux';
import Store from './redux/configureStore';
import History from './utils/history';
import Landing from './containers/Landing/Landing';
import MainPage from './containers/MainPage';
import ReceipsPage from './containers/Receips/ReceipsPage';
import DishPage from './containers/Dish/DishPage';
import NotFound from './containers/NotFound';
import './App.css';

const App = () => (
  <Provider store={Store}>
    <Router history={History}>
      <Switch>
        <Route exact path="/" component={Landing} />
        <Route path="/ingredients" component={MainPage} />
        <Route path="/receips" component={ReceipsPage} />
        <Route path="/dish/:name" component={DishPage} />
        <Route component={NotFound} />
      </Switch>
    </Router>
  </Provider>
);

export default App;
